#[repr(C)]
#[derive(Debug, Copy, Clone)]
pub struct cudnnFractionStruct {
    pub numerator: i64,
    pub denominator: i64,
}
#[test]
fn bindgen_test_layout_cudnnFractionStruct() {
    const UNINIT: ::std::mem::MaybeUninit<cudnnFractionStruct> = ::std::mem::MaybeUninit::uninit();
    let ptr = UNINIT.as_ptr();
    assert_eq!(
        ::std::mem::size_of::<cudnnFractionStruct>(),
        16usize,
        concat!("Size of: ", stringify!(cudnnFractionStruct))
    );
    assert_eq!(
        ::std::mem::align_of::<cudnnFractionStruct>(),
        8usize,
        concat!("Alignment of ", stringify!(cudnnFractionStruct))
    );
    assert_eq!(
        unsafe { ::std::ptr::addr_of!((*ptr).numerator) as usize - ptr as usize },
        0usize,
        concat!(
            "Offset of field: ",
            stringify!(cudnnFractionStruct),
            "::",
            stringify!(numerator)
        )
    );
    assert_eq!(
        unsafe { ::std::ptr::addr_of!((*ptr).denominator) as usize - ptr as usize },
        8usize,
        concat!(
            "Offset of field: ",
            stringify!(cudnnFractionStruct),
            "::",
            stringify!(denominator)
        )
    );
}
